import React from 'react';
import { Navbar } from 'react-bootstrap';
import Pokeball from '../img/Pokeball.png';

const PokeNav = () => {
    return (
        <Navbar bg="danger" variant="dark">
            <Navbar.Brand href="">
                <img
                    alt=""
                    src={Pokeball}
                    width="30"
                    height="30"
                    className="d-inline-block align-top"
                />
                {'PokeAPI'}
            </Navbar.Brand>
        </Navbar>
    );
}

export default PokeNav;
